import React from "react";
import Icons from "../User/Icons"
import "./Wheel.css"


class Wheel extends React.Component{
    state = {
        icons: ["mrGreen", "mrPink", "mrBlack"],
        wheelColors: []
    };

    randomIcons = () => {
        let tempArray = [];
        for(var i = 0; i < 10; i++){
            let random = Math.floor(Math.random(3));
            tempArray.push(this.state.icons[random]);
            console.log(random);
        }
        this.setState({wheelColors : tempArray});
    }

    render(){
        randomIcons;
        let iconElements = this.state.wheelColors.map((value)=>{
            return <Icons className = "icon" userName = {value} />
        });

        return(
            <div className="wheel">
                {iconElements}
            </div>
        );
    };
};

export default (Wheel);
